import React,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

    state = {lists: []}


callAPI() {
    fetch("/todo")
        .then(res => res.json())
        .then(lists => this.setState({ lists}));
}

componentWillMount() {
    this.callAPI();
}
render(){
  return(<p className="App-intro">
  {this.state.lists.map(list =>
   <div key={list.id}>{list}</div>
 )}
 </p>
  )
}
}


export default App;
